import React from "react";

function Navbar({apiDataArray})
{
return(
    <>
     {
        apiDataArray.map(
           (data)=>{
            return(
                <>
                <button>{data.category}</button>
                </>
            )
           }
        )
     }
    </>
)

}

export default Navbar;
